import React, { useState } from "react";
import Slider from "react-slick";
import Lightbox from "yet-another-react-lightbox";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
import "yet-another-react-lightbox/styles.css";
import fullscreenImg from "./image.png"

// Custom arrow components for better styling/control
function NextArrow(props) {
  const { className, style, onClick } = props;
  return (
    <div
      className={`${className} custom-arrow custom-next`}
      style={{ ...style, display: "block", right: "10px", zIndex: 1 }}
      onClick={onClick}
    />
  );
}

function PrevArrow(props) {
  const { className, style, onClick } = props;
  return (
    <div
      className={`${className} custom-arrow custom-prev`}
      style={{ ...style, display: "block", left: "10px", zIndex: 1 }}
      onClick={onClick}
    />
  );
}

function SynchronizedCarousel({ pics }) {
  const [slider1, setSlider1] = useState(null);
  const [slider2, setSlider2] = useState(null);
  const [lightboxOpen, setLightboxOpen] = useState(false);
  const [currentIndex, setCurrentIndex] = useState(0);

  // Main slider settings with custom arrows and fade effect
  const mainSettings = {
    asNavFor: slider2,
    ref: (slider) => setSlider1(slider),
    slidesToShow: 1,
    slidesToScroll: 1,
    arrows: true,
    fade: true,
    infinite: true,
    dots: false,
    beforeChange: (oldIndex, newIndex) => setCurrentIndex(newIndex),
    nextArrow: <NextArrow />,
    prevArrow: <PrevArrow />,
  };

  // Thumbnail slider settings with custom arrows
  const thumbSettings = {
    asNavFor: slider1,
    ref: (slider) => setSlider2(slider),
    slidesToShow: 6, // Adjust the number of visible thumbnails as needed
    swipeToSlide: true,
    focusOnSelect: true,
    infinite: true,
    arrows: true,
    dots: false,
    nextArrow: <NextArrow />,
    prevArrow: <PrevArrow />,
  };

  return (
    <div
      className="synchronized-carousel"
      style={{ maxWidth: "800px", margin: "0 auto" }}
    >
      {/* Main slider */}
      <div className="main-slider-wrapper" style={{ position: "relative" }}>
        <Slider {...mainSettings}>
          {pics.map((pic, idx) => (
            <div key={idx} className="main-slide">
              <img
                src={pic.original}
                alt={`Slide ${idx}`}
                className="main-image"
                style={{ width: "100%", height: "auto", cursor: "pointer" }}
                onClick={() => setLightboxOpen(true)}
              />
            </div>
          ))}
        </Slider>
        {/* Optional overlay fullscreen button */}
        <button
          className="fullscreen-button"
          onClick={() => setLightboxOpen(true)}
          style={{
            position: "absolute",
            bottom: "10px",
            right: "10px",
            padding: "8px 12px",
            backgroundColor: "white",
            color: "#fff",
            border: "none",
            cursor: "pointer",
          }}
        >
          <img src={fullscreenImg} className="icons" />
        </button>
      </div>

      {/* Thumbnail slider */}
      <div className="thumb-slider-wrapper" style={{ marginTop: "1rem" }}>
        <Slider {...thumbSettings}>
          {pics.map((pic, idx) => (
            <div key={idx} className="thumb-slide">
              <img
                src={pic.thumbnail}
                alt={`Thumbnail ${idx}`}
                className="thumbnail-image"
                style={{
                  width: "100%",
                  height: "80px", // Fixed height for consistency
                  objectFit: "cover", // Crop to fill while maintaining aspect ratio
                  cursor: "pointer",
                }}
              />
            </div>
          ))}
        </Slider>
      </div>

      {/* Lightbox for fullscreen viewing */}
      <Lightbox
        slides={pics.map((pic) => ({ src: pic.original }))}
        open={lightboxOpen}
        index={currentIndex}
        close={() => setLightboxOpen(false)}
      />
    </div>
  );
}

export default SynchronizedCarousel;
